É preciso defendê-los de maneira inequívoca por meio de nossas escolhas e ações.
O ataque militar da Rússia à Ucrânia é uma tentativa condenável de mudar o status quo da Europa por meio da força, estimula a retomada de uma corrida armamentista e coloca em risco a soberania... (+)
A defesa da paz, da soberania nacional e da legitimidade da ordem internacional sempre pautou a política externa brasileira. Quando esses princípios cardeais são violados, não há espaço para neutralidade. (+)
de países que lutaram contra as tiranias por liberdade e inserção na comunidade das nações.  
Portanto, nós, pré-candidatos à presidência da República, tornamos público o nosso repúdio à invasão da Ucrânia e oferecemos a nossa solidariedade ao povo ucraniano. (+)
Pedimos à Rússia que retome o caminho da diplomacia para a restauração da paz. 

Pedimos ao governo brasileiro que se posicione, unindo-se às nações que defendem a soberania da Ucrânia e a solução pacífica do conflito. 

